import React, { Component } from "react";
import "./App.css";
import Card from "./Card.js";
class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      emojis: [
        { emoji: "游때", flipped: false },
        { emoji: "游때", flipped: false },
        { emoji: "游때", flipped: false },
        { emoji: "游때", flipped: false },
        { emoji: "游때", flipped: false },
        { emoji: "游때", flipped: false },
        { emoji: "游때", flipped: false },
        { emoji: "游때", flipped: false },
        { emoji: "游때", flipped: false }
      ]
    };
    this.toggle = this.toggle.bind(this);
  }

  render() {
    const cards = this.state.emojis.map(i => {
      return <Card emoji={i} />;
    });
    return (
      <div className="App">
        This is AIT homework 08.
        {cards}
      </div>
    );
  }
}

export default App;
